import { Suspense } from 'react';
import { BrowserRouter as Router, Routes,Route,Navigate  } from "react-router-dom";
import {PublicRoute,PrivateRoute} from "./Routes/Routes";
import './Assests/main.scss';

function App() {
  return (
    <Router>
       <Routes>
       {PrivateRoute.map((route, index) => {
        return (
          <Route
            key={index}
            path={route.path}
            exact={route.exact}
            element={                  
              <Suspense fallback={<>...</>}>                   
              <route.element/>                  
              </Suspense>                
              }
          />
        );
      })}
    </Routes>
    <Routes>
       {PublicRoute.map((route, index) => {
        return (
          <Route
            key={index}
            path={route.path}
            exact={route.exact}
            element={                  
              <Suspense fallback={<>...</>}>                   
              <route.element/>                  
              </Suspense>                
              }
          />
        );
      })}
    </Routes>
   </Router>
  );
}

export default App;
